import React from 'react'
import Post from './Post'

function PostList() {
  return (
    <div>
        <Post title="Thom Yorke" content="Thomas Edward Yorke (born 7 October 1968) is an English musician who is the main vocalist and songwriter of the rock band Radiohead. A multi-instrumentalist, he mainly plays guitar and keyboards and is noted for his falsetto. He has been described by Rolling Stone as one of the greatest and most influential singers of his generation."/><br/>
        <Post title="Jonny Greenwood" content="Jonathan Richard Guy Greenwood (born 5 November 1971) is an English musician. He is the lead guitarist and keyboardist of the alternative rock band Radiohead, and has composed numerous film scores. He has been named one of the greatest guitarists by publications including Rolling Stone."/><br/>
        <Post title="Stanley Donwood" content="Dan Rickwood (born 29 October 1968), known professionally as Stanley Donwood, is an English artist and writer. Since 1994, he has created all the artwork for the rock band Radiohead with their singer, Thom Yorke, plus Yorke's other projects, including Atoms for Peace and the Smile. He also creates the artwork for Glastonbury Festival and has published books of writing."/><br/>
    </div>
  )
}

export default PostList
